Purchase of fields: <strong>A</strong> purchases from <strong>B</strong> agricultural fields (<em>zēru</em>). The sold land is located in the district of the town of Bit-&Scaron;annabau (<em>pihāt</em> Bit-&Scaron;annabi). It borders on the properties of the <em>kurgarr&ucirc;</em> of <sup>d</sup>Bani, <strong>C<sub>1</sub></strong>, <strong>C<sub>2</sub></strong>, <strong>C<sub>3</sub></strong> and <strong>C<sub>4</sub></strong> as well as on the royal road (<em>harrān &scaron;arri</em>). The measures of the land are mistakenly given as 5 x 0 cubits (2.5 x &hellip; m). Witnesses (including Rēmūtu and Kudurrānu from the Rabbane family) and the scribe. Invocation of the gods during the act of sealing.<br />
<br />
<strong>A</strong> = A&scaron;arēdu//Egibi; <strong>B</strong> = Zākiru//S&icirc;n-tabni; <strong>C<sub>1</sub></strong> = Aplāya//Gubāya; <strong>C<sub>2</sub></strong> = Nergal-ēṭir//Tamkāru; <strong>C<sub>3</sub></strong> = Nergal-ēṭir//S&icirc;n-ahhē-iddin; <strong>C<sub>4</sub></strong> = Nab&ucirc;-ēre&scaron;//Egibi; Scribe = Marduk-bēl&scaron;unu//Rab-ban&ecirc;

Promissory note for silver: 5 minas and 9 shekels of silver, the price of 155 sheep, of <strong>A</strong> are at the disposal (<em>ina pāni</em>) of <strong>B</strong>. The debt is secured by a pledge in terms of sheep. 5 witnesses and the scribe.<br />
<br />
<strong>A</strong> = Ninurta-u&scaron;ab&scaron;i; <strong>B</strong> = Bēl-ēṭir(//Miṣirāya); Scribe = &hellip;
